import React from "react";
import { CardNoFooter } from "../components/Card/Card";
import { Col, Grid, Row } from "react-bootstrap";
import FormikControl from "../components/Formik/FormikControl";
import { useDispatch, useSelector } from "react-redux";
import { getPercentReport } from "../redux/Selector/Selectors";
import { Form, Formik } from "formik";
import * as variable from "../variables/Variables"

function SystemConfiguration() {
  const systemConfigForm = useSelector((state) => getPercentReport(state));
  const initialValue = {
    // [variable.username]: "",
    [variable.percent]: "",
  };
  return (
    <Grid fluid style={{ margin: 0, padding: 0 }}>
      <CardNoFooter
        title=""
        content={
          <React.Fragment>
            <Formik
              initialValues={initialValue}
              validationSchema={validationSchema}
              onSubmit={onSubmit}
            >
              {(formik) => {
                return (
                  <Form>
                    {systemConfigForm.map((rows) => {
                      const columns = rows.row.cols;
                      return columns.map((column) => {
                        // const controlType = column.elementType;
                        const {
                          name,
                          type,
                          placeholder,
                          labeltext,
                        } = column.elementConfig;
                        return (
                          <FormControll
                            elementType="input"
                            type={type}
                            name={name}
                            placeholder={placeholder}
                            {...column}
                          />
                        );
                      });
                    })}
                  </Form>
                );
              }}
            </Formik>
          </React.Fragment>
        }
      />
    </Grid>
  );
}

export default SystemConfiguration;
